    false,nt"url": null,nt"notes": "This narrative report for Malheur National
    Wildlife Refuge outlines Refuge accomplishments from May of 1946 through April of
    1947. The report begins by summarizing the weather conditions, and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    plantings. Resource management is outlined; topics include grazing. The public relations
    section of the report describes recreational uses and Refuge visitors. Items of
    interest and N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
